import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element using a text-based selector
    // The element contains text like "0 Cart"
    const cartButton = page.locator('div.cart:has-text("Cart")');
    await cartButton.waitFor({ state: 'visible' });
    await cartButton.click();

    // Wait for the cart modal to become visible
    // The JavaScript sets style="display: block;" on the modal
    const cartModal = page.locator('#cartModal');
    await cartModal.waitFor({ state: 'visible' });

    // Take a screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal is open
    const modalTitle = await cartModal.locator('h2').textContent();
    const isModalVisible = await cartModal.isVisible();

    if (!isModalVisible || !modalTitle.includes('Your Shopping Cart')) {
      throw new Error('Shopping cart modal did not open correctly or title is wrong.');
    }

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalTitle: modalTitle,
        isModalVisible: isModalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, take a final screenshot if possible
    const screenshotsOnFailure = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshotsOnFailure.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to open the shopping cart modal",
      extractedData: {},
      screenshots: screenshotsOnFailure,
      error: error.message
    };
  }
}
